import React from 'react';
import {
    Nav,
    NavLink,
    Bars,
    NavMenu,
    NavLabel
} from './NavbarElements';

const Navbar = () => {
    return (
        <>
            <Nav>
                <Bars />

                <NavMenu>
                    <NavLabel>
                        LOGAN 
                        KEENER
                    </NavLabel>
                    <NavLink to='/resume' activeStyle>
                        Résumé
                    </NavLink>
                    <NavLink to='/projects' activeStyle>
                        Projects
                    </NavLink>
                    <NavLink to='/contact' activeStyle>
                        Contact Me
                    </NavLink>
                </NavMenu>
            </Nav>
        </>
    );
};

export default Navbar;
